import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';

import SearchPage from './SearchPage';
import ResultPage from './ResultPage';
import JobDetailPage from './JobDetailPage';
import TrendingPage from './TrendingPage';  // Pastikan file ini ada

// Komponen Navbar dengan tombol Tren Pencarian
function Navbar() {
  return (
    <nav style={{
      padding: '25px 20px',
      backgroundColor: '#2196f3',      // Warna navbar biru terang
      display: 'flex',
      alignItems: 'center',
      gap: '20px',
      boxShadow: '0 2px 5px rgba(33, 150, 243, 0.3)'  // Shadow warna biru
    }}>
      {/* Logo di kiri sebagai gambar */}
      <Link 
        to="/" 
        style={{ 
          display: 'flex',              // Supaya logo mudah disejajarkan
          alignItems: 'center',
          textDecoration: 'none',
        }}
      >
        <img 
          src="/logo.png"              // Pastikan logo.png ada di folder public
          alt="Logo KARSO" 
          style={{ height: '25px' }}  // Atur tinggi logo sesuai kebutuhan
        />
      </Link>

      {/* Tombol Tren Pencarian */}
      <Link 
        to="/trending"
        className="btn-custom"
        style={{
          marginLeft: 'auto',          // dorong ke kanan
          padding: '8px 25px',
          borderRadius: '30px',
          backgroundColor: '#1976d2',  // Warna tombol biru agak gelap
          color: 'white',
          fontWeight: '600',
          textDecoration: 'none',
          transition: 'background-color 0.3s ease',
        }}
        onMouseEnter={e => e.target.style.backgroundColor = '#1565c0'}  // Hover warna biru lebih gelap
        onMouseLeave={e => e.target.style.backgroundColor = '#1976d2'}
      >
        Tren Pencarian
      </Link>
    </nav>
  );
}

export default function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<SearchPage />} />
        <Route path="/results" element={<ResultPage />} />
        <Route path="/job-detail" element={<JobDetailPage />} />
        <Route path="/trending" element={<TrendingPage />} />
      </Routes>
    </Router>
  );
}
